import Image1 from '../Images/Image1.png';
import React from 'react'

function Slider() {
    

    
    return (
    <div className='parentDiv h-[540px] bg-white flex items-center justify-between'>
        <div className='slide'>
              <img
              className='w-full h-full'
                src={Image1}
                alt='slide_image'>
              </img> 
        </div>
        

    </div>
  ) 
}

export default Slider
